import Navbar from "./Navbar";
import Head_Component from "./Head_Component";

const Layout = (props) => (
    <div>
        <Head_Component title="Home" />
        <Navbar />
        <div className="container-fluid" style={{ padding: '1em'}}>
            {props.children}
        </div>
    </div>
)

export default Layout;
